import './App.css';
import {
    BrowserRouter,
    Routes,
    Route
} from "react-router-dom";
import Login from './components/page/login/LoginPage'
import ArtView from "./components/page/main/view/ArtView";
import CreateView from "./components/page/main/view/CreateView";
import SupportView from "./components/page/main/view/SupportView";
import MyView from "./components/page/main/view/MyView";

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/login" element={<Login/>}/>
                <Route path="/main/art" element={<ArtView/>}/>
                <Route path="/main/create" element={<CreateView/>}/>
                <Route path="/main/my" element={<MyView/>}/>
                <Route path="/main/support" element={<SupportView/>}/>
                {/*<Route exact path="/info" render={() => <Info userInfo={userInfo} />} />*/}
            </Routes>
        </BrowserRouter>
    );
}

export default App;
